well heck... i havent updated in for fucking ever... i'm at Brea's now, we got pretty crunked last night *thumbs up* basically i have been workin, goin to school, and juss chillin on the weekends... Friday night i went to Megan's party... H.O.L.Y S.H.I.T ... definately one of the best parties i have EVER been to... so much fun... played a drinking game called waterfall with some crazy guy... Molly, Brandie, and Kristi were there, they know all the people i know, but we never talk haha... but i talked to Brandie and we messed with this girl Angie, funny stuff... Chuck threw Angie in the pool and i had to play superhero and pull her out... oh my goooodnessss, i started bangin my foot on the floor and clapping my hands and Brandie started beat boxing and it was fucking amazing, STEP TEAM HERE WE COME... Megan was dancing to it, it was funny... we watched SNL (The Best Of Chris Farley) it has the sloppy joe song in there with Chris and Adam SO GOOD <3 uhm yeah so it was an awesome night, lots more happened, too lazy to type it lol... last night the words of the night were BADONKADONK and SHIFTY FIVVVEEE good stuff... "NIKI SAY BADONKADONK! PLEEEAAASEEEEEE!" oh yeah, i hurt my knee friday, dont remember how, but Niki looked at it (of course i didnt hehe) and she said it look scuffed up like i fell, dont remember, dont care hehe... i limped on it pretty bad and i didnt mean to, it was embarassing and Brea kept teasing me because she is a poopy face... i did get both of my knees rubbed by my wonderful girlfriend... this morning my knee that wasnt hurt, hurts because i was limping, real effin cute... but anywho, i'm guna go chill with BOOGA BREA! CRUNK POWER! work today 5-8 or 930 cant remember...

&hearts;

BRADY!
